<?php

namespace App\Command;

use App\Entity\Generation;
use App\Entity\Type;
use App\Repository\GenerationRepository;
use App\Repository\PokemonRepository;
use App\Repository\TypeRepository;
use Doctrine\DBAL\Connection;
use Doctrine\ORM\EntityManagerInterface;
use Symfony\Component\Console\Command\Command;
use Symfony\Component\Console\Input\InputArgument;
use Symfony\Component\Console\Input\InputInterface;
use Symfony\Component\Console\Input\InputOption;
use Symfony\Component\Console\Output\OutputInterface;
use Symfony\Component\Console\Style\SymfonyStyle;
use Symfony\Component\Validator\Constraints\Count;


class DatabaseFillCommand extends Command
{
    protected static $defaultName = 'database-fill';
    protected static $defaultDescription = 'This command will fill the pokemon-team-builder database with data of all the generations, types and pokemon';

    private $em;
    private $generationRepository;
    private $typeRepository;
    private $pokemonRepository;
    private $connection;

    public function __construct(EntityManagerInterface $em, TypeRepository $typeRepository, GenerationRepository $generationRepository, PokemonRepository $pokemonRepository, Connection $connection)
    {
      parent::__construct();
      $this->em = $em;
      $this->generationRepository = $generationRepository;
      $this->typeRepository = $typeRepository;
      $this->pokemonRepository = $pokemonRepository;
      $this->connection = $connection;
    }

    protected function configure()
    {
        $this
            ->setDescription(self::$defaultDescription)
            ->addArgument('arg1', InputArgument::OPTIONAL, 'Argument description')
            ->addOption('option1', null, InputOption::VALUE_NONE, 'Option description')
        ;
    }

    protected function execute(InputInterface $input, OutputInterface $output): int
    {
        $io = new SymfonyStyle($input, $output);
        $arg1 = $input->getArgument('arg1');

        if ($arg1) {
            $io->note(sprintf('You passed an argument: %s', $arg1));
        }

        if ($input->getOption('option1')) {
            // ...
        }

        $io->success('Database completion ongoing, checking current database for updates');

        $apiGenerationUrl = 'https://pokeapi.co/api/v2/generation/';

        $apiTypesUrl = 'https://pokeapi.co/api/v2/type/';
  
        $typesImages = [
                        'https://cdn.pixabay.com/photo/2018/05/20/21/00/pokemon-3416764_1280.png',
                        'https://cdn.pixabay.com/photo/2018/05/20/01/40/pokemon-3414806_1280.png',
                        'https://cdn.pixabay.com/photo/2018/05/20/01/40/pokemon-3414808_1280.png',
                        'https://cdn.pixabay.com/photo/2018/05/20/21/00/pokemon-3416765_1280.png',
                        'https://cdn.pixabay.com/photo/2018/05/20/21/00/pokemon-3416762_1280.png',
